(function(){Date.prototype.format=function(c){if(!c){c="YYYY-MM-DD hh:mm:ss"}var a={"Y+":this.getFullYear(),"M+":this.getMonth()+1,"D+":this.getDate(),"h+":this.getHours(),"m+":this.getMinutes(),"s+":this.getSeconds()};if(new RegExp("(Y+)").test(c)){c=c.replace(RegExp.$1,(""+a["Y+"]).substr(4-RegExp.$1.length))}for(var b in a){if(new RegExp("("+b+")").test(c)){c=c.replace(RegExp.$1,RegExp.$1.length==1?a[b]:("00"+a[b]).substr((""+a[b]).length))}}return c}})();